Vilniuje vyko centrinės turo rungtynės, kadangi ten susitiko dar pralaimėjimų nepatyrusios ekipos – Vilniaus VHC „Šviesa“ ir Kauno „Granitas – Karys“. Kauniečiai šiame mače praktiškai nuo susitikimo pradžios perėmė iniciatyvą ir laikė rungtynių kontrolę. Mindaugas Urbonas  įrodė, jog buvo ne veltui išrinktas geriausiu spalio mėnesio lygos žaidėju ir tempė savąją ekipą į priekį. Po pirmojo kėlinio Kauno „Granitas – Karys“ pirmavo rezultatu 17:12, o susitikimą laimėjo 30:25. Tai buvo jau penktoji Kauno ekipos pergalė naujajame „Vivus.lt“ rankinio lygos sezone. Kauno „Granitas – Karys“:  Mindaugas Urbonas 10, Vaidas Drevinskas 8, Modestas Štarolis 4, Tadas Bučinskas, Karolis Grigas ir Tomas Valiulis po 2. Vilniaus VHC „Šviesa“:   Valdas Drabavičius  8, Jovydas Jurašius 5, Tadas Rasakevičius ir Artūras Švilpa po 3. (function(d, s, i, r) {
