		})(document, 'script', 'facebook-jssdk', 'fb-root'); Ne ką prastesnis mūšis vyko tarp kitos sostinės ekipos HC „Vilniaus“ bei praėjusių metų vicečempionų Alytaus „Varsos – Stronglaso“. Alytiškiai sugebėjo pratęsti pergalių seriją ir rungtyniaudami išvykoje prieš visuomet gerai namie žaidžiančius vilniečius. Šiame mače Vilnius ekipos gretose vėl galima buvo matyti po pertraukos sugrįžusį Šarūną Sakalauską. Alytaus, kaip ir Kauno rankininkai, įsirašė taipogi penktąją pergalę ir kol kas žygiuoja itin užtikrintai. Susitikimą „Varsa – Stronglasas“ laimėjo rezultatu  29:25. Šarūnas Sakalauskas  (HC „Vilnius“): „Nors sugrįžimas ne toks, kokio norėtųsi, bet šaunu buvo vėl žaisti su komanda „Vivus.lt“ rankinio lygoje po pertraukos. Pačios rungtynės buvo banguotos. Pradžioje labai gerai kovojome, bėgome į greitą puolimą. Antras kėlinys prasidėjo labai prastai, gal užmigome kėlinio pradžioje, bet šaunu, kad sukovojome ir nepaleidome rungtynių“ Žygimantas Micevičius (Alytaus „Varsa-Stronglasas“): „Rungtynės, kaip ir tikėjomės, buvo sunkios, aišku, niekada nebūna lengva atvažiuoti į Vilnių. Sunki pradžia, gynyba strigo, praleidome kelis, galima sakyti, įdomius įvarčius. Antrajame kėlinyje išėjome jau apšilę, pradžioje pabėgome, bet paskui tikriausiai per anksti patikėjome pergale ir rezultatas nėra toks, kokio norėtume.“ Alytaus „Varsa – Stronglasas“:  Žygimantas Micevičius 8, Remigijus Čepulis 5, Nedas Buronko, Aurelijus Sabonis ir Irmantas Asakavičius po 4. Vilniaus HC „Vilnius“:  Karolis Antonovičius 8, Šarūnas Sakalauskas 5,  Martynas Lapinskas , Domantas Raudonis ir  Mindaugas Stravinskas  po 3. Varėnoje dėl pirmosios pergalės šiame sezone bandė kautis šeimininkė „Ūla“ ir praėjusiame ture istorinę klubui pergalę jau iškovojęs „KTU“ klubas. Nors Varėna jau turi įgijusi namų komandos statusą, tačiau gausiai savo numylėtinių palaikyti susirinkę varėniškiai pergalės neišvydo ir šįkart. Pirmajame kėlinyje tarp ekipų dar vyko lygi kova ir po 30 minučių rezultatas buvo lygus (19:19), tačiau Viliaus Juozaičio vedami lygos debiutantai solidžiau sužaidė antrąjį rungtynių kėlinį ir iškovojo antrą pergalę iš eilės. Galutinis rungtynių rezultatas  42:35  „KTU“ klubo naudai. Darius Talačka („KTU“): „Pasiekėm pergalę. Tikrai sudėtinga, žiūrovai padarė savo darbą. Bet ačiū Dievui antram kėlinyje padarėm savo darbą, mobilizavomės ir sustygavom gynybą, kas ir buvo kertinis dalykas į pergalę. Tikrai nelengva pergalė, varžovai sudėtingi ir stiprūs, deja, bet dar tų taškų jiems teks palaukti.“ Gintarė Krapukaitienė (Varėnos „Ūla“): „Komanda buvo nusiteikusi rimtai kovai, kadangi patys žino, kad mūsų lygmuo šiai dienai yra panašus su komandomis, kuriomis žaidžiam. Prie pralaimėjimo prisidėjo kai kurių žaidėju treniruočių stoka, jie patys tai mato. Tikimės padarysim išvadas dėl šios problemos. Šiai dienai, viskas buvo kaip ir gerai, pagrinde buvo akcentuojama gynyba. Tokį rezultatą, kurį praleidom šiai dienai yra neleistina. Turim daryt išvadas ne tik dėl žaidimo, bet ir dėl treniruočių lankomumo. Kokio rezultato siekiam, tokį gaunam.“ Kauno „KTU“:  Vilius Juozaitis 12, Ignas Grigas 8, Karolis Jankauskas ir Deividas Jovaišas po 6, Arminas Stankūnas 5. Varėnos „Ūla“:  Deivas Eidukonis 14, Kęstutis Ikasala 6, Gražvydas Sereičikas ir Rolandas Bliznevič po 3. Mažiausiai intrigos laukta Šiauliuose, kur susitiko dar pergalių šiame sezone neiškovojus „Dubysa – Gubernija“ ir čempiono titulą ginantis Klaipėdos „Dragūnas“. Vis tik šiauliečiai nors liko be pergalių ir po šių rungtynių, tačiau lengvos kovos „Dragūnas“ negavo. Sužaidus pirmąsias 30 susitikimo minučių Klaipėdos klubo persvara siekė vos 2 įvarčius (16:14), tačiau antrojo kėlinio jau pačioje pradžioje svečiai sugebėjo dar šiek tiek padidinti atotrūkį ir tą persvarą išlaikyti iki pat susitikimo pabaigos. Klaipėdos „Dragūnas“ iškovojo ir ketvirtąją pergalę naujame sezone, šįkart rezultatu  33:27  įveikdamas garbingai besipriešinusią Šiaulių komandą. Kaip jau įprasta Šiaulių ekipoje ir vėl nesustabdomai žaidė Arūnas Tribė, o klaipėdiečius į priekį vedė ir Lietuvos rinktinės marškinėlius jau pasimatavęs Žanas Gabrielius Virbauskas, kuris į Klaipėdą persikėlė būtent iš Šiaulių klubo. Klaipėdos „Dragūnas“:  Žanas Gabrielius Virbauskas 10, Laurynas Palevičius ir Lukas Vanagas po 5,  Gintaras Cibulskis  ir  Karolis Bliuvas  po 3. Šiaulių SM „Dubysa – Gubernija“:  Arūnas Tribė 9, Eligijus Baranauskas ir Deivydas Virbauskas po 6,  Paulius Morkūnas  3.
